import { USERS_TOTAL } from "../actions/ActionTypes";

export default function(state = {}, action) {
    switch (action.type) {
      case TOTAL_USERS:
        return Object.assign({}, state, {
          users: action.payload
        });
        default:
        return state;
    }
  }
